/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `product_breakage_report` AS select `pr`.`id` AS `id`,`pr`.`name` AS `product_name`,`pr`.`product_category_id` AS `product_category_id`,`pr`.`store_id` AS `store_id`,coalesce(sum(`b`.`total_units`),0) AS `breakage_qty`,coalesce(sum(`b`.`total_amount`),0) AS `breakage_amount` from (`products` `pr` left join `breakages` `b` on((`pr`.`id` = `b`.`product_id`))) group by `pr`.`id` */;

