/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `product_stock_report` AS select `p`.`id` AS `product_id`,`p`.`product_name` AS `product_name`,`c`.`id` AS `category_id`,`c`.`name` AS `category_name`,`p`.`store_id` AS `store_id`,coalesce(`p`.`purchase_qty`,0) AS `purchase_qty`,coalesce(`p`.`purchase_amount`,0) AS `purchase_amount`,coalesce(`s`.`sale_qty`,0) AS `sale_qty`,coalesce(`s`.`sale_amount`,0) AS `sale_amount`,coalesce(`b`.`breakage_qty`,0) AS `breakage_qty`,coalesce(`b`.`breakage_amount`,0) AS `breakage_amount`,((coalesce(`p`.`purchase_qty`,0) - coalesce(`s`.`sale_qty`,0)) - coalesce(`b`.`breakage_qty`,0)) AS `balance_qty`,(coalesce(`s`.`sale_amount`,0) - coalesce(`p`.`purchase_amount`,0)) AS `profit_amount` from (((`product_purchase_report` `p` left join `product_sale_report` `s` on((`s`.`id` = `p`.`id`))) left join `product_breakage_report` `b` on((`b`.`id` = `p`.`id`))) left join `product_categories` `c` on((`c`.`id` = `p`.`product_category_id`))) */;

